//get account with DB
app.get('/accounts', function (req, res) {
  account.find({}, function (err, docs) {
    res.send(docs)
  })
})


// ////////
app.put('/addAccount', (req, res) => {
  const { body } = req;

  const { name, img, feed } = body;

  // insert one item
  const newAccount = new account({ name: name, img: img, feed: feed });
  newAccount.save().then(() => console.log('done'));
  res.send({ existAcount: true });
})
